import React from "react";
import Card from "../components/Card";

const gigs = [
  {
    title: "gig",
    city: "city",
    rate: "rate",
    desc: "desc",
    schedule: "schedule",
    startDate: "startDate",
  },
];

function StaffGig() {
  return (
    <div>
      {gigs.map((gig) => (
        <Card
          title={gig.title}
          city={gig.city}
          desc={gig.desc}
          rate={gig.rate}
          schedule={gig.schedule}
          startDate={gig.startDate}
        />
      ))}
      <Card title={"title"} />
    </div>
  );
}

export default StaffGig;
